Promotional info - &quot;Ultimate War is a comic book limited series produced by Marvel Comics featuring the Ultimates and the Ultimate X-Men. The series contains four books, released between December 8, 2002 and February 23, 2003. It was written by Scottish comics author Mark Millar with art by Chris Bachalo. This was the first time the Ultimates as a team had crossed over with characters from the Ultimate Marvel Universe. After the world finds out that Magento is alive and living at the X-Mansion, the Ultimates are sent to investigate.&quot;

All four issues of the miniseries are in digital copies, thanks to Minutemen-PhD. Please seed and enjoy. 

